import React from 'react';
import { Link, Route, Router } from 'react-router-dom';

function ListUsersItem({ user }) {
    return (
        <>
            <Router>
                <Route path="/album">
                    <Link><li>{user.name}</li></Link>
                </Route>
            </Router>
        </>
    );
}

export default ListUsersItem;
